import { useState } from "react";
// import classes from "./Admin.module.css";

export default function Logs({ user }) {
  const [logs, setLogs] = useState([]);

  return (
    <div>
      {logs.map((log) => {
        return <h1>{log}</h1>;
      })}
    </div>
  );
}
